import React, { useState, useEffect } from 'react';
import { Table } from 'react-bootstrap';

function NeracaLajurPage() {    
    const [NeracaLajur, setNeracaLajur] = useState([]);
    const [loading, setLoading] = useState(true);


    useEffect(() => {
        setLoading(true);
        fetch(`http://localhost:7000/api/transactions/neraca-lajur`)
            .then((res) => res.json())
            .then((data) => {
                setNeracaLajur(data.data);
                setLoading(false); 
            });

    },  []);
    const formatValue = (value) => (value === 0 ? "-" : value || "-");
    return (
        <div>
            <div className="d-flex justify-content-between align-items-center mb-4">
            <h2>Neraca</h2>
            </div>
                {loading ? (
                        <div className="text-center">Loading...</div>
                    ) : (
                        <Table striped bordered hover>
                            <thead>
                                <tr>
                                    <th rowSpan={2}>Kode</th>
                                    <th rowSpan={2}>Nama Akun</th>
                                    <th colSpan={2}>Neraca Saldo</th>
                                    <th colSpan={2}>Penyesuaian</th>
                                    <th colSpan={2}>Neraca Saldo <br/> Setelah Penyesuaian</th>
                                    <th colSpan={2}>Rugi Laba</th>
                                    <th colSpan={2}>Modal</th>
                                    <th colSpan={2}>Neraca</th>
                                </tr>
                                <tr>
                                    <th>Debit</th>
                                    <th>Credit</th>
                                    <th>Debit</th>
                                    <th>Credit</th>
                                    <th>Debit</th>
                                    <th>Credit</th>
                                    <th>Debit</th>
                                    <th>Credit</th>
                                    <th>Debit</th>
                                    <th>Credit</th>
                                    <th>Debit</th>
                                    <th>Credit</th>
                                </tr>
                            </thead>
                            <tbody>
                            {NeracaLajur.map((item, index) => (
                                <tr key={index}>
                                    <td>{item.akun?.code}</td>
                                    <td>{item.akun?.name}</td>
                                    <td>{item.neracaSaldo?.debit || "-"}</td>
                                    <td>{item.neracaSaldo?.kredit || "-"}</td>
                                    <td>{formatValue(item.neracaPenyesuaian?.debit)}</td>
                                    <td>{item.neracaPenyesuaian?.kredit || "-"}</td>
                                    <td>{item.saldoPenyesuaian?.debit || "-"}</td>
                                    <td>{item.saldoPenyesuaian?.kredit || "-"}</td>
                                    <td>{item.rugiLaba?.debit || "-"}</td>
                                    <td>{item.rugiLaba?.kredit || "-"}</td>
                                    <td>{item.neracaModal?.debit || "-"}</td>
                                    <td>{item.neracaModal?.kredit || "-"}</td>
                                    <td>{item.neracaNeraca?.debit || "-"}</td>
                                    <td>{item.neracaNeraca?.kredit || "-"}</td>
                                </tr>
                            ))}
                            </tbody>
                        </Table>  
                    )}
                </div>
    );
}

export default NeracaLajurPage;
